VALUES ('8431562090192', 'Pularda trufada asada al horno', 'Ingredientes Pularda trufada: Pularda semi-deshuesada tratada en salazón 60% (agua, jarabe de glucosa,sal, aromas naturales), relleno 40% [carne y grasa de cerdo, vino Oporto(sal, aroma natural),agua,trompetas de la muerte 4,5%, trozos de trufas blancas de verano 2% (tuber aestivum, jugo de trufas, sal), setas, chalotas, sal, pimienta]. Ingredientes de la salsa Oporto albaricoques, trompetas de la muerte y uvas pasas: agua, vino Oporto modificado 9,6% (SULFITOS) (Oporto, aroma natural), cebollas, fondo de carne (agua, maltodextrina, aromas, caramelo aromático, extracto de buey carne de ternera, sal, extracto de zanahorias y extracto de setas, colorante: E100) orejones de albaricoques 4.2% (albaricoque seco, harina de arroz) (SULFITOS), aceite de girasol, concentrado de tomates, uvas pasas 2,1% (aceite de algodón), almidón modificado de arroz, ajo, trompetas de la muerte 0,7%, azúcar, sal, pimienta.', 'https://static.openfoodfacts.org/images/products/843/156/209/0192/front_es.5.400.jpg', '10', '3.2', '0.6', '0.1', '', '22', '0.7', '0.275590551181102', '', '1');

